import './App.css'
import logo from './senseimoonlogo.png'
import bg from './outerspace.jpeg'

function App() {
  return (
    <div className="App">
      <div className='main-container'>
        <header>
          <h1>Sensei Moon</h1>
        </header>
        <div className='logo-container'>
          <img src={logo} alt='sensei moon logo' />
        </div>
      </div>
    </div>
  );
}

export default App;
